              behavior: "smooth"
            });
            console.info("document.querySelector(\".forgame-games-header__item--is-active\").getBoundingClientRect().left", document.querySelector(".forgame-games-header__item--is-active").getBoundingClientRect().left);
            document.querySelector(".forgame-games-body__item--is-active").classList.remove("forgame-games-body__item--is-active");
            document.querySelectorAll(".forgame-games-body__item")[index].classList.add("forgame-games-body__item--is-active");

          });
        });
      }, 2000);
    },
    created() {
    },
